@GobiernoMX ¡Mentirosos!

@lopezobrador_ no se pudo contener y actuar como un presidente demócrata.  Metió mano donde pudo.

Los ciudadanos nos apoyamos en el @INEMexico y ustedes atentaron contra nuestra organización.

No salgan con su visión retorcida de la historia.  Llevamos años bien.
